function workout(input) {
    let n = Number(input[0]);
    let kmFirstDay = Number(input[1]);
    let result = kmFirstDay;
    let totalKm = kmFirstDay;

    for (let i = 2; i < input.length; i++) {
        result += result * Number(input[i]) / 100;
        totalKm += result;
    }

    if (totalKm >= 1000) {
        let extraKm = Math.ceil(Math.abs(totalKm - 1000));
        console.log(`You've done a great job running ${extraKm} more kilometers!`);
    } else {
        let insuficientKm = Math.ceil(Math.abs(totalKm - 1000));
        console.log(`Sorry Mrs. Ivanova, you need to run ${insuficientKm} more kilometers`)
    }
}

