function orbit(input) {
  let rows = input[0];
  let cols = input[1];
  let starRow = input[2];
  let starCol = input[3];

  let matrix = [];

  for (let i = 0; i < rows; i++) {
    matrix[i] = [];
  }
  for (let row = 0; row < rows; row++) {
    for (let col = 0; col < cols; col++) {
      matrix[row][col] =
        Math.max(Math.abs(row - starRow), Math.abs(col - starCol)) + 1;
    }
  }
  console.table(matrix);
}
